" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 523px\">",
"   <div class=\"ttl\">",
"    Macrocystic Type I CPAM at 26 weeks of gestation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 503px; height: 478px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
