" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Acetaminophen (paracetamol): Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"    see \"Acetaminophen (paracetamol): Patient drug information\"",
"   </a>",
"   and",
"   <a class=\"drug drug_pediatric\" href=\"UTD.htm?19/15/19705?source=see_link\">",
"    see \"Acetaminophen (paracetamol): Pediatric drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"block spa drugH1Div\" id=\"F11391964\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Special Alerts",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Acetaminophen: Transition of Pediatric Liquid Products to Standard Concentration",
"     </span>",
"     <span class=\"collapsible-date\">",
"      June 2011",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:0em;margin-top:2em;\">",
"       Based on recommendations provided by the Food and Drug Administration (FDA), all over-the-counter (OTC) pediatric single-ingredient acetaminophen liquid products will transition to a single concentration of 160 mg/5 mL; the transition has already begun and will continue into 2012.  The concentration of acetaminophen infant drops (previously 80 mg/0.8 mL) will now be the same as children&rsquo;s acetaminophen products (160 mg/5 mL) and as a result, new dosing on a volume-per-weight (or volume-per-age) basis will apply. The recommended mg/kg dose is unaffected and continues to be 10-15 mg/kg/dose.",
"      </p>",
"      <p style=\"text-indent:0em;margin-top:2em;\">",
"       Healthcare professionals should be aware that during this transition, acetaminophen infant drop products with both the new and old concentrations may be available on pharmacy shelves. Parents may continue to use either product, but should verify concentration and use according to labeled dosing directions. Healthcare professionals should verify product concentration prior to providing dosing information.",
"      </p>",
"      <p style=\"text-indent:0em;margin-top:2em;\">",
"       Additional information can be found at  file://www.tylenolprofessional.com/index.html",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
