"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;text-align:justify;\">",
"     <i>",
"      Rectal:",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-top:0em;text-align:justify;\">",
"     Infants and Children &lt;12 years: 10-20 mg/kg/dose every 4-6 hours as needed; do",
"     <b>",
"      not",
"     </b>",
"     exceed 5 doses (2.6 g) in 24 hours.",
"     <b>",
"      Note:",
"     </b>",
"     Although the perioperative use of high-dose rectal acetaminophen (eg, 25-45 mg/kg/dose) has been investigated in several studies, its routine use remains controversial; optimal doses and dosing frequency to ensure efficacy and safety have not yet been established (Buck, 2001).",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Children &ge;12 years and Adolescents: Refer to adult dosing.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:2em;\">",
"     <i>",
"      I.V.:",
"     </i>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Children 2-12 years: 15 mg/kg every 6 hours",
"     <b>",
"      or",
"     </b>",
"     12.5 mg/kg every 4 hours; maximum single dose: 15 mg/kg/dose; maximum daily dose: 75 mg/kg/day (&le;3.75 g daily)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Adolescents: Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block doe drugH1Div\" id=\"F129324\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Geriatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Refer to adult dosing.",
"    </p>",
"   </div>",
"   <div class=\"block dor drugH1Div\" id=\"F129325\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Renal Impairment",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Oral (Aronoff, 2007):",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Children:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &lt;10 mL/minute: Administer every 8 hours.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Intermittent hemodialysis or peritoneal dialysis: Administer every 8 hours.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     CRRT: No adjustments necessary.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     Adults:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     10-50 mL/minute: Administer every 6 hours.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &lt;10 mL/minute: Administer every 8 hours.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     Intermittent hemodialysis or peritoneal dialysis: No adjustment necessary.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:6em;text-align:justify;\">",
"     CRRT: Administer every 8 hours.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     I.V.: Cl",
"     <sub>",
"      cr",
"     </sub>",
"     &le;30 mL/minute: Use with caution; consider decreasing daily dose and extending dosing interval.",
"    </p>",
"   </div>",
"   <div class=\"block doh drugH1Div\" id=\"F129326\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Hepatic Impairment",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:0em;text-align:justify;\">",
"     Oral: Use with caution. Limited, low-dose therapy is usually well tolerated in hepatic disease/cirrhosis. However, cases of hepatotoxicity at daily acetaminophen dosages &lt;4 g daily have been reported. Avoid chronic use in hepatic impairment.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;margin-top:0em;text-align:justify;\">",
"     I.V.:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-top:0em;text-align:justify;\">",
"     Mild-to-moderate impairment: Use with caution in hepatic impairment or active liver disease; manufacturer&rsquo;s labeling suggests a reduced total daily dosage may be warranted, although no specific dosage adjustments are provided.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;margin-top:0em;text-align:justify;\">",
"     Severe impairment: Use is contraindicated.",
"    </p>",
"   </div>",
