var title_f15_27_15803="Recommended nutritional supplementation after bariatric surgery";
var content_f15_27_15803=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F80913&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F80913&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommended nutritional supplementation after bariatric surgery in adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Gastric bypass",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Standard multivitamin with folate and iron, or prenatal vitamin if female*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin B12 500 micrograms orally daily, or 1000 micrograms intramuscularly monthly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Calcium 1200 mg to 1500 mg daily with 800 units vitamin D",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Supplemental iron if iron deficient*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Adjustable banding",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Standard multivitamin with folate and iron* or prenatal vitamin if female*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin B12, iron, calcium with vitamin D as indicated clinically",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Additional iron and folate may be necessary in pregnant females.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     Calcium citrate may be better absorbed.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
