var title_f15_27_15804="Clinical features PNFA";
var content_f15_27_15804=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F76782&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F76782&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    The clinical diagnostic features of progressive nonfluent aphasia: Clinical profile",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Disorder of expressive language is the dominant feature initially and throughout the disease course. Other aspects of cognition are intact or relatively well preserved.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        I. Core diagnostic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A. Insidious onset and gradual progression",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        B. Nonfluent spontaneous speech with at least one of the following: agrammatism, phonemic paraphasias, anomia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        II. Supportive diagnostic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        A. Speech and language",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1. Stuttering or oral apraxia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2. Impaired repetition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3. Alexia, agraphia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        4. Early preservation of word meaning",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        5. Late mutism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        B. Behavior",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1. Early preservation of social skills",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2. Late behavioral changes similar to FTD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        C. Physical signs: late contralateral primitive reflexes, akinesia, rigidity, and tremor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        D. Investigations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        1. Neuropsychology: nonfluent aphasia in the absence of severe amnesia or perceptuospatial disorder",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        2. Electroencephalography: normal or minor asymmetric slowing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        3. Brain imaging (structural and/or functional): asymmetric abnormality predominantly affecting dominant (usually left) hemisphere",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Neary D, Snowden JS, Gustafson L, et al. Frontotemporal lobar degeneration: A consensus on clinical diagnostic criteria. Neurology 1998; 51:1546. Copyright &copy; 1998 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
